4. Quality

      4.1 Shipper represents and warrants that all Gas tendered for transportation at the Receipt Point(s) shall meet the Quality Specifications. "Quality Specifications" means, for each constituent, the more stringent of (i) the quality specifications required for the acceptance of Gas by any downstream pipeline, or (ii) Transporter's quality specifications set forth below (or as modified from time to time or as provided in any Confirmation or Agency Agreement on a non-discriminatory basis):

      4.1.1 Have a Heating Value of not less than nine hundred fifty (950) Btu per cubic foot nor more than one thousand one hundred (1,100) Btu per cubic foot;

      4.1.2 Be commercially free of dust, gum, gum-forming constituents, gasoline, liquid hydrocarbons, water, and any other substance of any kind that may become separated from the Gas during the handling thereof or that may cause injury to or interference with proper operation of the lines, meters, regulators, or other appliances through which it flows;

      4.1.3 Not contain more than 1 grain total sulfur, including mercaptans and hydrogen sulfide, per one hundred (100) standard cubic feet;

      4.1.4 Not contain more than ten (10) parts per million of oxygen, and shall not contain more than two percent (2%) by volume of carbon dioxide, not contain more than three percent (3%) by volume of nitrogen or four percent (4%) by volume of total inert gases;

      4.1.5 Have a temperature of not more than one hundred twenty degrees Fahrenheit (120?F) nor less than forty degrees Fahrenheit (40?F);

      4.1.6 Not contain more than seven (7) pounds of water vapor per one million (1,000,000) standard cubic feet; and

4.1.7 Have a hydrocarbon dew point below ten degrees Fahrenheit (10?F).

      4.2 In the event that the Gas being received does not conform to the standards outlined above, Transporter may, in its reasonable discretion and on a non-discriminatory basis, accept such Gas or restrict or refuse any volumes that are non-conforming or deficient.

      4.3 Shipper shall be responsible for odorizing any part of the Gas delivered hereunder at the Delivery Point(s) which is diverted and/or used for any purpose for which odorization is required pursuant to regulations of the Louisiana Office of Conservation.

      4.4 In the event that Shipper's Gas fails to conform to any of the Quality Specifications set forth above, including, but not limited to the hydrocarbon dew point or the gross heating value or any other specification set forth above or to a more restrictive specification imposed by a downstream pipeline to which Shipper has nominated Gas, Transporter, in its discretion and on a non-discriminatory basis, may accept such off-specification Gas for transportation and delivery to such downstream pipeline provided that Shipper has made arrangements to ensure that such off- specification Gas conforms to the applicable specification, including but not limited to any arrangements to treat, condition, or blend with other Gas (prior to it reaching such downstream pipeline). Upon request from Transporter, Shipper shall provide documentation acceptable to Transporter demonstrating that Shipper has made such contractual arrangements for such off-specification Gas on the path for which Shipper has nominated Gas. This provision shall not be construed as a general waiver to Transporter's Quality Specifications and is only available where physical blending, treatment and conditioning of Gas is contracted for and will take place prior to reaching the downstream pipeline whose specifications are to be met and such acceptance and service by Transporter shall not adversely impact markets on Transporter's system.

7. Force Majeure

      7.1 If either party is rendered unable, wholly or in part, by Force Majeure (defined below) or other causes herein specified, to carry out its obligations under this Agreement other than the obligation to make payment of amounts due hereunder, it is agreed that on such party's promptly giving notice and reasonably full particulars of such Force Majeure in writing or facsimile or by email to the other party within a reasonable time after the occurrence of the cause relied on, then the obligations of the party giving such notice, so far as such obligations are affected by such Force Majeure or other causes herein specified, shall be suspended during the continuance of any inability so caused, but for no longer period, and such cause shall so far as possible be remedied with all reasonable dispatch. Nothing hereunder shall require Shipper to receive gas that, in Shipper's reasonable discretion, Shipper cannot safely accommodate.

      7.2 The term Force Majeure as employed herein means any cause, to the extent not reasonably within the control of the party claiming suspension and which, by the exercise of reasonable diligence, such party is unable, wholly or in part, to prevent or overcome, including:

(a) acts of God, the government, including the issuance of rules or orders which serve to frustrate or prevent the performance of Transporter, or the public enemy;

(b) strikes, lockouts or other industrial disturbances;

(c) sabotage, wars, blockades, insurrections, riots or civil disturbances of any kind, protests, or acts of terror;

(d) epidemics;

(e) landslides, lightning, earthquakes, fires, storms, storm warnings, hurricanes, floods, or washouts;

(f) arrests and restraints of the government and people, either federal or state, civil or military;

(g) explosions, breakage, breakdown or accident to machinery, equipment or lines of pipe;

(h) 	the necessity of altering, maintaining, inspecting, replacing, changing the size of, substituting or removing pipelines or appurtenant facilities;

(i) freezing of wells or lines of pipe or other delivery facilities;

(j) electric power unavailability or shortages;

(k) instances where either party hereto is required to obtain servitudes, right-of-way grants, permits or licenses to enable such party to fulfill its obligations hereunder, the inability of such party to acquire, or the delays on the part of such party in acquiring, at reasonable cost and after the exercise of reasonable diligence, such servitudes, right-of-way grants or licenses;

(l) instances where either party hereto is required to furnish materials and supplies for the purpose of constructing or maintaining facilities or is required to secure permits, consents, authorizations or approvals from any governmental agency or authority (federal, state or municipal, international, civil or military) to enable such party to fulfill its obligations hereunder, the inability of such party to acquire or the delays on the part of such party in acquiring, at reasonable cost and after the exercise of reasonable diligence, such materials and supplies, permits, consents, authorizations or approvals;

(m) 	curtailment or interruption of deliveries, receipts or services by third party purchasers, suppliers or customers as a result of an event of Force Majeure, or a breach by such third party purchasers, suppliers or customers, or any action by any third party pipelines connected to Transporter's pipeline that would prevent or delay Transporter in crossing any third party pipeline or obtaining with any third party pipeline a functional interconnection (capable of receiving Gas and available for commercial service); and

(n) any other causes, whether of the kind herein enumerated or otherwise, not reasonably within the control of the party claiming suspension, and which by the exercise of due diligence such party is unable, wholly or in part, to prevent or overcome.

      7.2.1 It is understood and agreed that the settlement of strikes or lockouts shall be entirely within the discretion of the party having the difficulty and that the above requirement that any Force Majeure shall be remedied with all reasonable dispatch shall not require the settlement of strikes or lockouts by acceding to the demands of the opposing party when such course is inadvisable in the discretion of the party having the difficulty.

      7.3 In the case of Shipper, Force Majeure does not include: mechanical failure or breakdown of electric generation plants, changes in market conditions or changes in demand for electricity at electric generation plants such as increases or decreases in electric generation that are required by the Midcontinent Independent System Operator, or any other agency or body having such authority, or failure of upstream transportation prior to delivery hereunder at the Receipt Point(s). To be clear, nothing in the preceding sentence is intended to require Shipper to receive Gas that, in Shipper's reasonable discretion, Shipper cannot safely accommodate. Notwithstanding anything herein to the contrary, neither party shall be entitled to the benefits of Section 7.1 to the extent the event of Force Majeure is caused or affected by any or all of the following circumstances: (i) the party claiming excuse failed to remedy the condition and to resume the performance of its covenants or obligations with reasonable dispatch; or (ii) economic hardship, to include, without limitation, Shipper's ability to sell its Gas at a higher or more advantageous price to a market not requiring the transportation services contracted for herein; or (iii) the loss of Shipper's market or Shipper's inability to use or resell Gas transported hereunder, or (iv) the loss or failure of Shipper's Gas supply (except for failure of mechanical equipment provided for under Section 7.2) or depletion of reserves, unless such loss or failure is a result of a Force Majeure event in upstream facilities from the interconnect with Transporter to the receipt point on the gathering facility; provided however such Force Majeure shall not relieve Shipper from any obligations for dedications or commitments of Gas to Transporter made under or pursuant to the Service Agreement or any applicable Confirmation.

      7.4 Either party may partially or entirely interrupt its performance hereunder for the purpose of making necessary or scheduled inspections, alterations and repairs which are described as a maintenance event, but only for such time as may be reasonable and unavoidable; and the party requiring such relief shall give to the other party five (5) Days' notice of its intention to suspend its performance hereunder, except in cases of emergency where such notice is impracticable and shall endeavor to arrange such interruption so as to inconvenience the other party as little as possible. Should a Force Majeure or maintenance event occur the volumes to be delivered and/or received at the Receipt Point(s) and Delivery Point(s) by Transporter must be balanced with the hourly and daily nominated quantities.
